import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';

class AddTaskForm extends React.Component {
  render() {
    return (
      <Container fluid = {true} style = {{marginRight: "50px", borderRadius: "20px", marginTop: "100px", backgroundColor: "#F0F0F0", display: "flex", justifyContent: "center", textAlign: "center"}}>
          <Row style = {{paddingTop: "25px", paddingBottom: "25px"}}>
            <Col lg = {5} style = {{padding: 0, height: "40px"}}>
                <Form>
                    <Form.Group as={Col} controlId="formGridState">
                        <Form.Control as="select">
                            <option>Choose...</option>
                            <option>...</option>
                        </Form.Control>
                    </Form.Group>
                </Form>
            </Col>
            <Col lg = {5}>
                Add Task
            </Col>
            <Col lg = {1} style = {{border: "1px solid black"}}>
                Button
            </Col>
          </Row>
      </Container>
);}}

export default AddTaskForm;
